package come.syntax.class2;

public class IncrementOperator {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		
		int number=10;
	System.out.println(number);
	
		number=number+1;
		number=number+number;
		System.out.println(number);
		
		number++;
		System.out.println(number);
		
		System.out.println("***********");
		
		
		
		
		
		
	}

}
